const Page = ({ numRows, handlePage }) => {
  const numPages = Math.ceil(numRows.length / 10)
  const pageArr = new Array(numPages).fill(0)

  const pageLinks = pageArr.map((num, idx) => {

    return <Link number={idx+1} handlePage={handlePage} />
  })

  return (
    <p>{numPages > 1 ? "page: " : null} {numPages > 1 ? pageLinks : null}</p>
  )
}

const Link = ({ number, handlePage }) => {
  const handleSinglePage = (e) => {
    e.preventDefault()
    handlePage(number)
  }
  return (
    <a onClick={handleSinglePage}>{number} </a>
  )
}

export default Page
